/**
 * 用来定义默认数据，并导出一个函数
 */
/**定义默认数据 */
const defaultState = {
  str: "zhangsha fg"
}


/**传实际参数就用实际参数，不传就用 defaultState*/
export default (state = defaultState, action) => {
  return state;
}
